import "./App.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import { useEffect } from "react";
import { useState } from "react";

function App() {
  const [repoName, setRepoName] = useState();

  useEffect(() => {
    fetch("https://api.github.com/orgs/Netflix/repos")
      .then((res) => res.json())
      .then(
        (result) => {
          console.log(result);
          setRepoName(result.name);
        },
        (error) => {
          console.log(error);
        }
      );
  }, []);
  return (
    <div className="App w-100 min-vh-100 justify-content-center align-items-center d-flex">
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src="img/logo192.png" />
        <Card.Body>
          <Card.Title>{{ repoName }}</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </div>
  );
}

export default App;
